import React, { Component, useState } from 'react';

function SignupComedian(){

    const [newComedian, setComedian] = useState({
        name: "",
        headshot_link: "",
        website: "",
        city: "",
        genre: ""
    })

    const changeHandler = (e) => {
        setComedian({ [e.target.name]: e.target.value })
        console.log(e.target.value)
    }

    return(
        <div className="signup">
            <h1>Comedian Signup</h1>
            <form>
                <input name="name" type="text" placeholder="enter name" value={newComedian["name"]} onChange={changeHandler} /> <br></br>
                <input name="headshot_link" type="text" placeholder="enter link to headshot" value={newComedian["headshot_link"]} onChange={changeHandler} /> <br></br>
                <input name="website" type="text" placeholder="enter personal website" value={newComedian["website"]} onChange={changeHandler} /> <br></br>
                <input name="city" type="text" placeholder="enter city" value={newComedian["city"]} onChange={changeHandler} /> <br></br>
                <input name="genre" type="text" placeholder="enter genre" value={newComedian["genre"]} onChange={changeHandler} /> <br></br>
            </form>
        </div>

    )
}

export default SignupComedian
